import { takeLatest } from "redux-saga/effects";

import { getPostAllSaga } from "./post/postFeed/getPostAll";
import { getPostSaga } from "./post/postFeed/getPost";
import { addPostSaga } from "./post/postFeed/addPost";
import { updatePostSaga } from "./post/postFeed/updatePost";
import { removePostSaga } from "./post/postFeed/removePost";
import { ADD_POST, GET_POST, GET_POST_ALL, REMOVE_POST, UPDATE_POST } from "./post/postFeed/types";

import { getCommentAllSaga } from "./post/comment/getCommentAll";
import { getCommentSaga } from "./post/comment/getComment";
import { addCommentSaga } from "./post/comment/addComment";
import { updateCommentSaga } from "./post/comment/updateComment";
import { removeCommentSaga } from "./post/comment/removeComment";
import { ADD_COMMENT, GET_COMMENT, GET_COMMENT_ALL, REMOVE_COMMENT, UPDATE_COMMENT } from "./post/comment/types";

import { getPostHugSaga } from "./post/hug/getPostHug";
import { addPostHugSaga } from "./post/hug/addPostHug";
import { removePostHugSaga } from "./post/hug/removePostHug";
import { ADD_POST_HUG, GET_COMMENT_HUG, GET_POST_HUG, REMOVE_POST_HUG } from "./post/hug/types";

import { getCommentHugSaga } from "./post/hug/getCommentHug";

import { getImageSaga } from "./image/getImage";
import { GET_IMAGE } from "./image/types";

import { getTeamAllSaga } from "./team/getTeamAll";
import { GET_TEAM_ALL } from "./team/types";

export function* watcherSaga() {
	yield takeLatest(GET_POST_ALL, getPostAllSaga);
	yield takeLatest(GET_POST, getPostSaga);
	yield takeLatest(ADD_POST, addPostSaga);
	yield takeLatest(UPDATE_POST, updatePostSaga);
	yield takeLatest(REMOVE_POST, removePostSaga);

	yield takeLatest(GET_COMMENT_ALL, getCommentAllSaga);
	yield takeLatest(GET_COMMENT, getCommentSaga);
	yield takeLatest(ADD_COMMENT, addCommentSaga);
	yield takeLatest(UPDATE_COMMENT, updateCommentSaga);
	yield takeLatest(REMOVE_COMMENT, removeCommentSaga);

	yield takeLatest(GET_POST_HUG, getPostHugSaga);
	yield takeLatest(ADD_POST_HUG, addPostHugSaga);
	yield takeLatest(REMOVE_POST_HUG, removePostHugSaga);

	yield takeLatest(GET_COMMENT_HUG, getCommentHugSaga);

	yield takeLatest(GET_IMAGE, getImageSaga);

	yield takeLatest(GET_TEAM_ALL, getTeamAllSaga);

}
